import React from 'react';
import TableWrapper from '../AntTables.styles';
import services from '../../services';
import { Table } from 'antd';
import { TabPane } from '@iso/components/uielements/tabs';
import { Tag } from 'antd';
export default function() {
  const columns = [
    {
      title: 'Tên dịch vụ',
      dataIndex: 'name',
      key: 'name',
      width: 120,
      ellipsis:true
    },
    {
      title: 'Giá',
      dataIndex: 'price',
      key: 'price',
      width: 120,
      ellipsis:true
    },
    {
      title: 'Giá ưu đãi',
      dataIndex: 'price_discount',
      key: 'price_discount',
      width: 120,
      ellipsis:true
    },
    {
      title: 'Mô tả',
      dataIndex: 'description',
      key: 'description',
      width: 200,
      ellipsis:true
    },
    {
      title: 'Hình ảnh',
      dataIndex: 'picture',
      key: 'picture',
      width: 120,
      ellipsis:true
    },
    {
      title: 'Thời gian thực hiện',
      dataIndex: 'time_estimate',
      key: 'time-estimate',
      width: 120,
      ellipsis:true
    },
    {
      title: 'Book online',
      dataIndex: 'can_book_online',
      key: 'address',
      width: 120,
      ellipsis:true,
      value: bookonline=>{
        if (bookonline == 0){
          return(
          <Tag key={bookonline}>
                Is True
          </Tag>
          );
        }
        else{
          return(
            <Tag  key={bookonline}>
                Is True
          </Tag>
          );
        }
      }
    },
    // {
    //   title: 'Dành cho',
    //   dataIndex: 'sextype',
    //   key: 'sextype',
    // },

  ];
  const myColTitleStyle = {
    textOverflow: 'ellipsis',
    overflow: "hidden",
    whiteSpace: 'nowrap'
  };
  return (
    <Table dataSource={services.data.data} columns={columns} style={myColTitleStyle} />
  );
}
